import project1 from '../assets/project1.png';
import project2 from '../assets/project2.png';
import project3 from '../assets/project3.png';

const PROJECTS = [
    {
        id: 1,
        title: 'React Application Portfolio',
        discription: 'Building first React application involving JS and core web dev concepts!!',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project1
    },
    {
        id: 2,
        title: 'My API',
        discription: 'Build Restfull API that is built with GET and POST methods from scratch.',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project2
    },
    {
        id: 3,
        title: 'Survey Application',
        discription: 'A survey can be taken just by sharing the created survey through mails, messages and so on.',
        link: 'https://github.com/aaditi2034/Portfolio',
        image: project3
    }
];

export default PROJECTS;
